let letter = firstName.charAt(0).toUpperCase();

let URL = "http://localhost:5000/users?email=" + email;

const LargeProfileIcon = ({ letter }) => {
  return (
    <div className="user-icon-2">
      {letter}
    </div>
  );
}
};
